import React from "react";
import { Button, Header, Image, Modal, Message } from "semantic-ui-react";
import Form from "./Form.js"

const ModalModalExample = (props) => (
  <Modal trigger={<Button>Add a review!</Button>}>

    <Modal.Header>  <center> Review Form   </center></Modal.Header>
    <Modal.Content image>
      <Modal.Description>

 
    <Form Error={props.Error} SubmitForm={props.SubmitForm}  TextBook={props.TextBook} Difficulty={props.Difficulty} TakeAgain={props.TakeAgain}   About={props.About}/>

      </Modal.Description>
    </Modal.Content>


  </Modal>
);

export default ModalModalExample;
